               <Link to = "/" style ={{textDecoration:'none'}}> <h1 style={{marginTop:'1.3rem', color:'#3f51b5'}}>Movies App</h1></Link>
               <Link to = "/faviourates" style={{textDecoration:'none'}}><h2 style = {{marginLeft:'3rem', marginTop:'1.5rem', color:'#3f51b5'}}>Favourites</h2></Link>
               
            </div>
        )
    }
}
